/** 
 * anan optimize script  
 * 20230714
 * */
let svg_large = [];
let svg_small = [];
let line_type = 'TLS Line Map Large';
let line_no = [];
let line_name = '';
let work_center = '';
let linedata = [];
let linenamefull;

data.series.forEach((s) => {
  if (s.refId === 'BASIC_DATA' && s.fields && s.fields.length > 0) {
    const basicDataFields = s.fields;
    const svg1Field = basicDataFields.find((f) => f.name === 'svg_1');
    const svg2Field = basicDataFields.find((f) => f.name === 'svg_2');
    const lineSecField = basicDataFields.find((f) => f.name === 'line_sec');
    const lineNameField = basicDataFields.find((f) => f.name === 'line_name');

    if (svg1Field && svg2Field && lineSecField && lineNameField && lineNameField.values && lineNameField.values.length > 0) {
      svg_large = svg1Field.values.buffer;
      svg_small = svg2Field.values.buffer;
      line_no = lineSecField.values.buffer;
      line_name = lineNameField.values.buffer[0].trim();
    }
  } else if (s.refId === 'LINE_TYPE' && s.fields && s.fields.length > 0) {
    const lineTypeField = s.fields.find((f) => f.name === 'linetype');
    const workCenterField = s.fields.find((f) => f.name === 'workcenter');

    if (lineTypeField && lineTypeField.values && lineTypeField.values.length > 0 && workCenterField && workCenterField.values && workCenterField.values.length > 0) {
      const lineTypeValue = lineTypeField.values[0];
      const workCenterValue = workCenterField.values[0];
      line_type = (lineTypeValue === '2') ? 'TLS Line Map Large' : 'TLS Line Map Small';
      work_center = workCenterValue;
      linenamefull = line_name + ' (' + work_center + ') ';
    }
  } else if (s.refId === 'TLS_DATA_ORG' && s.fields && s.fields.length > 0) {
    const nameField = s.fields.find((f) => f.name === 'name');
    const valueField = s.fields.find((f) => f.name === 'value');

    if (nameField && nameField.values && valueField && valueField.values) {
      for (let i = 0; i < nameField.values.length; i++) {
        const nameValue = nameField.values[i];
        const valueValue = valueField.values[i];
        if (nameValue && valueValue) {
          linedata.push({ name: nameValue, value: valueValue });
        }
      }
    }
  }
});

echarts.registerMap('TLS Line Map Large', { svg: svg_large[0] });
echarts.registerMap('TLS Line Map Small', { svg: svg_small[0] });

