// });

let option = {
  backgroundColor: 'transparent',
  title: {
    show: false,
    text: `${linenamefull}${replaceVariables("${__from:date:YYYY-MM-DD}")}`,
    left: 'center',
  },
  tooltip: {
    formatter: (defect) => `${defect.seriesName}<br\>${defect.name}:  ${defect.value.toFixed(2)}%`,
  },
  visualMap: {
    show: false,
    left: '1%',
    bottom: 'center',
    min: 0,
    max: 100,
    orient: 'vertical',
    text: ['', 'Pass Rate(%)'],
    realtime: true,
    calculable: true,
    inRange: {
      color: [
        '#DC3545', '#DC3545', '#DC3545', '#DC3545', '#DC3545', '#DC3545', '#DC3545', '#DC3545',
        '#FFC107',
        '#28A745'
      ],
    },
    hoverLink: false, // Disable color range change on hover
  },
  series: [
    {
      name: linenamefull,
      type: 'map',
      map: line_type,
      top: '1%',
      left: 'center',
      bottom: '1%',
      roam: false,
      emphasis: {
        label: {
          show: false,
          formatter: (defect) => defect.value.toFixed(2) + '%',
        },
      },
      selectedMode: false,
      data: linedata,
    },
  ],
};

return option;

let cpName = [];
let cpValue = [];
let cpRate = [];
let dvLine = '';
let work_center = '';

data.series.forEach((s) => {
  if (s.refId === 'PROCESS_DATA') {
    debugger
    const tdNameField = s.fields.find((f) => f.name === 'tdname');
    const tdValueField = s.fields.find((f) => f.name === 'tdvalue');

    // Handle the case where tdNameField or tdValueField is undefined
    if (tdNameField && tdValueField) {
      cpName = tdNameField.values;
      cpValue = tdValueField.values;
    }
  } else if (s.refId === 'DATA_SECTION') {
    const workcenterField = s.fields.find((f) => f.name === 'workcenter');

    // Handle the case where workcenterField is undefined
    if (workcenterField) {
      work_center = workcenterField.values;
    }
  }
});

var arr = [];


var arrayLength = cpName.length;
for (var i = 0; i < arrayLength; i++) {
  //var item = { value: cpValue[i], name: cpRate[i].toFixed(0) + '% ' + cpName[i] };
  var item = { value: cpValue[i], name: cpName[i] };
  arr.push(item);
}


let option = {
  backgroundColor: 'transparent',
  tooltip: {
    trigger: 'item'
  },
  series: [
    {
      name: replaceVariables("${sec_no:text}") + '(' + work_center + ')',
      type: 'pie',
      radius: '65%',
      /*
      data: [
        { value: 1048, name: 'Search Engine' },
        { value: 735, name: 'Direct' },
        { value: 580, name: 'Email' },
        { value: 484, name: 'Union Ads' },
        { value: 300, name: 'Video Ads' }
      ],
      */
