      emphasis: {
        itemStyle: {
          shadowBlur: 10,
          shadowOffsetX: 0,
          shadowColor: 'rgba(0, 0, 0, 0.5)'
        }
      },
      label: {
        formatter: function (obj) {
          return obj.percent.toFixed(0) + '% ' + obj.data.name;
        },
        fontSize: 14,
        //width: 200,
        alignTo: 'labelLine',
        position: 'outer',
        edgeDistance: '10%'
      },
      labelLine: {
        lineStyle: {
          width: 2.5,
        }
      },
    }
  ]
};

